		"id": 1488999501356490800,
		"id_str": "1488999501356490753",
		"full_text": "@danielfromearth @LocoQf Sure, we all have experiences -- which is to say that we are all aware of the world. But whatever that world is made of, it's not made of seeing and feeling, any more than it's made of breathing and digesting. They are things organisms do.",
